 const apiKey = 'IJOenGlf1E4kdldSCQ4s59BP2r9jsKeo';

 const peticion = fetch(`https://api.giphy.com/v1/gifs/random?api_key=${ apiKey }`);

 peticion.then( resp => {
    resp.json().then ( data => {
        console.log(data)
    })
 })
 .catch( console.warm );
